import navIcons from './nav/all';
import preferencesIcons, {
  preferencesChosen,
  preferencesUnchosen,
} from './preferences/all';
import roomTypeIcons, {
  roomTypeChosen,
  roomTypeUnchosen,
} from './roomType/all';
import contactIcons from './contact/all';
import miscIcons from './misc/all';
import facilityIcons from './facilities/all';
import filterIcons from './filter/all';
import carouselIcons from './carousel/all';

export {
  navIcons,
  preferencesIcons,
  preferencesChosen,
  preferencesUnchosen,
  roomTypeIcons,
  roomTypeChosen,
  roomTypeUnchosen,
  contactIcons,
  miscIcons,
  facilityIcons,
  filterIcons,
  carouselIcons,
};
